//https://leetcode.com/problems/find-all-anagrams-in-a-string/submissions/
class Solution {
    var map_p = [Character: Int]()
    
    func findAnagrams_2(_ s: String, _ p: String) -> [Int] {
        let len = p.count
        if s.count < len {
            return []
        }
        
        if map_p.count == 0 {
            for c in p {
                if let value = map_p[c] {
                    map_p[c] = value + 1
                } else {
                    map_p[c] = 1
                }
            }
        }
        
        var result = [Int]()

        // 以p的长度为窗口，首先计算第一个窗口
        var map_s = [Character: Int]()
        let ls = Array(s)
        var j = 0
        while j < p.count {
            let c = ls[j]
            if let value = map_s[c] {
                map_s[c] = value + 1
            } else {
                map_s[c] = 1
            }
            
            j += 1
        }
        
        if map_s == map_p {
            result.append(0)
        }
        
        // 窗口向后滑动，除去头尾，由于中间的数都是一样的，只需最头尾做处理
        var i = p.count
        while i < s.count {
            // 尾部
            let end = ls[i]
            
            // +1
            if let count = map_s[end] {
                map_s[end] = count + 1
            } else {
                map_s[end] = 1
            }
            
            // 头部
            let begin = ls[i - p.count]
            // -1
            if let count = map_s[begin] {
                if count == 1 {
                    map_s.removeValue(forKey: begin)
                } else {
                    map_s[begin] = count - 1
                }
            }

            if map_s == map_p {
                result.append(i - p.count + 1)
            }

            i += 1
        }
        
        return result
    }
    
    // 超时
    func findAnagrams(_ s: String, _ p: String) -> [Int] {
        let len = p.count
        if s.count < len {
            return []
        }
        
        if map_p.count == 0 {
            for c in p {
                if let value = map_p[c] {
                    map_p[c] = value + 1
                } else {
                    map_p[c] = 1
                }
            }
        }
        
        let ls = Array(s)
        var result = [Int]()
        
        var i = 0
        while i <= s.count - len {
            
            let sub = Array(ls[i..<i+len])
            if isAnagram(sub) {
                result.append(i)
            }
            
            i += 1
        }
        
        return result
    }
    
    func isAnagram(_ s: [Character]) -> Bool {
        
        var map_s = [Character: Int]()
        
        for c in s {
            if let value = map_s[c] {
                map_s[c] = value + 1
            } else {
                map_s[c] = 1
            }
        }
        
        // 比较
        for (k,v) in map_s {
            if let v2 = map_p[k] {
                if v2 != v {
                    return false
                }
            } else {
                return false
            }
        }
        
        return true
        
    }
}

let s = ""

let p = ""

let obj = Solution()
print(obj.findAnagrams_2(s, p))


